import React from 'react';
import PopularTicker from './popularTicker';
import QuicklyView from './quicklyView';

function HomeComp() {
    return (
        <>
            <div className = 'row mx-auto'>
                <div className = 'col-md-6 py-'>
                    <PopularTicker />
                </div>

                <div className = 'col-md-6'>
                    <QuicklyView />
                </div>
            </div>            
        </>
    );
}

export default HomeComp;
